import React from 'react';

import './HabitItem.css';

const HabitItem = props => {
    return (
        <section id="habit-item-section">
            <li className="habit-item">
                <h2>{props.name}</h2>
            </li>
            <p>Delete</p>
        </section>
    );
};

export default HabitItem;
